output = ""

for char in characters:
    char = textToBinary(char)
    position = classPostion[char]
    descriptionBits = 0

    if position != 0:
        descriptionBits = math.ceil(math.log2(position))

    positionDescriptonLength = bin(descriptionBits)

    correctDescriptionBits = math.ceil(math.log2(maxBitsPerClass))
    currentDescriptionBits = len(positionDescriptonLength) - 2

    missingDescriptionBits =  correctDescriptionBits - currentDescriptionBits

